// src/pages/HealthWellnessApps.js
import React from 'react';
import VideoPlayer from '../components/VideoPlayer';
import './HealthWellnessApps.module.css'

const videos = [
  { title: 'Fitness Apps Overview', url: 'https://www.youtube.com/watch?v=3Z2J5RNXUuM' },
  { title: 'Managing Health Apps', url: 'https://www.youtube.com/watch?v=Ks-_Mh1QhMc' },
];

const HealthWellnessApps = () => (
  <div>
    <h2>Health & Wellness Apps Videos</h2>
    {videos.map((video, index) => (
      <div key={index}>
        <h3>{video.title}</h3>
        <VideoPlayer url={video.url} />
      </div>
    ))}
  </div>
);

export default HealthWellnessApps;
